  XW += x[34] * 2.9021999999999998e+01; // NNH
  XW += x[35] * 3.0006000000000000e+01; // NO
  XW += x[36] * 4.6005000000000003e+01; // NO2
  XW += x[37] * 4.4012999999999998e+01; // N2O
  XW += x[38] * 3.1014000000000003e+01; // HNO
  XW += x[39] * 2.6018000000000001e+01; // CN
  XW += x[40] * 2.7025999999999996e+01; // HCN
