  XW += x[51] * 4.3045000000000002e+01; // CH2CHO
  XW += x[52] * 4.4052999999999997e+01; // CH3CHO
  XW += x[53] * 2.0006403162999998e+01; // HF
  XW += x[54] * 1.8998403162999999e+01; // F
  XW += x[55] * 3.7996806325999998e+01; // F2
  XW += x[56] * 3.4033403162999996e+01; // CH3F
  XW += x[57] * 5.2023806325999992e+01; // CH2F2
  XW += x[58] * 7.0014209488999995e+01; // CHF3
  XW += x[59] * 8.8004612651999992e+01; // CF4
  XW += x[60] * 3.3025403163000000e+01; // CH2F
  XW += x[61] * 5.1015806325999996e+01; // CHF2
  XW += x[62] * 6.9006209489000000e+01; // CF3
  XW += x[63] * 3.2017403162999997e+01; // CHF
  XW += x[64] * 5.0007806325999994e+01; // CF2
  XW += x[65] * 3.1009403162999998e+01; // CF
